message:
Спецоперация, 13 апреля. Главное:

▪️Российские войска освободили населенный пункт Первомайское на авдеевском направлении, сообщило Минобороны;

▪️Киев за сутки потерял более 900 военных, один танк, западную артиллерию;

▪️Сбиты 222 украинских беспилотника, 8 снарядов HIMARS и Vampire, одна управляемая авиабомба JDAM, добавили в российском военном ведомстве;

▪️Украинские войска сбросили с беспилотника взрывоопасный объект и обстреляли 11 снарядами Донецк, шестью кассетными боеприпасами  Горловку, сообщили в ДНР;

▪️Германия собирается поставить Киеву ещё одну систему ПВО Patriot, сообщил телеканал n-tv со ссылкой на минобороны;

▪️Главком ВСУ Сырский заявил о существенном обострении обстановки на восточной линии фронта из-за активизации наступательных действий ВС РФ, которые "добиваются тактического успеха";

▪️Минобороны России сообщило, что 9 военнослужащих 25-й отдельной воздушно-десантной бригады ВСУ сдались в плен в районе Водяного в ДНР на авдеевском направлении.
